import style from "./AboutProject.module.scss";
import { Container } from "../Container/Container";
export const AboutProject = () => {
  return <div className={style.aboutproject}>
    <Container>
      <div className={style.about_container}>
        <img src="./assets/img_about.png" alt="" />
        <div className={style.items_about}>
          <h2>О проекте</h2>
          <div><p>Иммигрант.Сегодня - информационный портал, который помогает людям иммигрировать и адаптироваться (обжиться) в Канаде</p></div>
        </div>
      </div>
    </Container>
  </div>;
};
